import React from "react";
import { SmileCoordinates } from "./types";

interface Props {
  image?: string;
  coords?: SmileCoordinates[];
}

const SmileViewer: React.FC<Props> = ({ image, coords }) => (
  <div className="card">
    <div className="card-body">
      {image ? (
        <img src={image} alt="Detected Smile" className="img-fluid mb-3" />
      ) : (
        <p className="text-center">No Image Available</p>
      )}
      <h5 className="card-title">Smile Coordinates</h5>
      <pre>{coords ? JSON.stringify(coords, null, 2) : "No smile detected"}</pre>
    </div>
  </div>
);

export default SmileViewer;
